export const formatPriceToCommaPrice = (inputValue) => {
    if (typeof inputValue === 'number') {
        inputValue = Math.round(inputValue.toFixed(2)).toString(); // Ensure two decimal places
    }

    // Ensure inputValue is a string
    if (typeof inputValue !== 'string') {
        console.error("inputValue must be a string or number");
        return;
    }

    let index = inputValue.indexOf(".") + 3;
    let newVal;

    if (inputValue.indexOf(".") > 0) {
      newVal = inputValue.slice(0, index);
    } else {
      newVal = inputValue;
    }

    let numericValue = newVal.replace(/[^\d.]/g, '');

    numericValue = numericValue.replace(/^0+(\d)/, '$1');

    let [integerPart, decimalPart] = numericValue.split('.');

    if (integerPart.length > 3) {
      let lastThree = integerPart.slice(-3);
      let otherNumbers = integerPart.slice(0, -3);
      if (otherNumbers !== '') {
        lastThree = ',' + lastThree;
      }
      integerPart = otherNumbers.replace(/\B(?=(\d{2})+(?!\d))/g, ",") + lastThree;
    }

    if (decimalPart !== undefined) {
      numericValue = integerPart + '.' + (decimalPart || '');
    } else {
      numericValue = integerPart;
    }
    return numericValue;
};


export const removeCommasFromValue = (event) => {
  const { value: inputValue } = event.target;
  event.target.value = formatPriceToCommaPrice(inputValue);
  let val = event.target.value ? event.target.value.replace(/\,/g,'') : "";
  return val;
};


export function inWords (numb) {
  //let val = numb.replace(/\,/g,'');
  let num = Math.round(numb);
  var a = ['','One ','Two ','Three ','Four ', 'Five ','Six ','Seven ','Eight ','Nine ','Ten ','Eleven ','Twelve ','Thirteen ','Fourteen ','Fifteen ','Sixteen ','Seventeen ','Eighteen ','Nineteen '];
  var b = ['', '', 'Twenty','Thirty','Forty','Fifty', 'Sixty','Seventy','Eighty','Ninety'];

  if ((num = num.toString()).length > 9) return 'Not Valid, Please Contact Helpline Number';
  if (num == 0) return '';
  let n = ('000000000' + num).substr(-9).match(/^(\d{2})(\d{2})(\d{2})(\d{1})(\d{2})$/);
  if (!n) return; 
  var str = '';
  str += (n[1] != 0) ? (a[Number(n[1])] || b[n[1][0]] + ' ' + a[n[1][1]]) + 'Crore ' : '';
  str += (n[2] != 0) ? (a[Number(n[2])] || b[n[2][0]] + ' ' + a[n[2][1]]) + 'Lakh ' : '';
  str += (n[3] != 0) ? (a[Number(n[3])] || b[n[3][0]] + ' ' + a[n[3][1]]) + 'Thousand ' : '';
  str += (n[4] != 0) ? (a[Number(n[4])] || b[n[4][0]] + ' ' + a[n[4][1]]) + 'Hundred ' : '';
  str += (n[5] != 0) ? ((str != '') ? 'and ' : '') + (a[Number(n[5])] || b[n[5][0]] + ' ' + a[n[5][1]]) + '' : '';

  if(str !== ""){
    return "₹ " + str + " Rupees Only ";
  }else{
    return "Not Valid, Please Contact Helpline Number";
  }
}

export function itemScrollIntoView (elId, center) {
    setTimeout(()=>{
        let element = document.getElementById(elId);
        if(element) {
            if(center){
              element.scrollIntoView({
                block: 'center',
              });
            }else{
              element.scrollIntoView();
            }
        }
    },200);
};

export const isBlobURL = (url) => {
    if(url != undefined && url != null && url != "" && url.startsWith != undefined){
        if (!Array.isArray(url)) {
            return url.startsWith('blob:');
        } else {
            return url[0].startsWith('blob:');
        }
    }
};

